COMMENT ON TABLE MUNICIPIOS IS 
'A Tabela de Cdigo de Municpios IBGE  uma lista numrica de cdigos que
identifica cada municpio brasileiro. Esses cdigos so utilizados pelo
Instituto Brasileiro de Geografia e Estatstica (IBGE) para coletar,
organizar e disponibilizar dados estatsticos sobre as caractersticas e
indicadores socioeconmicos dos municpios do pas.

A tabela  composta por seis dgitos, sendo os dois primeiros referentes ao
cdigo do estado e os quatro ltimos ao cdigo do municpio dentro do estado.
Por exemplo, o cdigo 355030 representa o municpio de So Paulo, que est
localizado no estado de So Paulo. O cdigo 110020 representa o municpio de
Porto Velho, que est localizado no estado de Rondnia.

A Tabela de Cdigo de Municpios IBGE  amplamente utilizada por rgos
governamentais, empresas, pesquisadores e outros usurios que precisam de
informaes estatsticas sobre os municpios brasileiros.';


